import * as React from 'react';
import { mergeReactProps } from './mergeReactProps.js';
export function evaluateRenderProp(render, props, state) {
  return typeof render === 'function' ? render(props, state) : /*#__PURE__*/React.cloneElement(render, {
    ...mergeReactProps(render.props, props),
    ref: props.ref
  });
}
